import React from 'react';
import images from "../Utilities/ImageDirectories/CampusWatchImages.json"
import Profile from './Profile';
import ReverseProfile from './ReverseProfile';
import FadeIn from './FadeIn';

function Page() {
  return (
    <div className="min-h-screen flex flex-col" id='outreaches'>
        <header className="bg-gray-200 py-4 px-8">
        <h1 className="text-3xl font-bold">EVANGELISATION: OUTREACHES DONE BY THE MINISTRY</h1>
      </header>
      <FadeIn bodyText={
        <Profile title={"Gospel Football Tournament 2024"} imagesrc={"images/Carousel_Images/FootballTournamentPhotos/PXP-1291.jpg"} text={"The Gospel Football Tornament came about as a result of Evangelising the youths for Christ. The 16 Team tournament was held all through the month of July 2024 in Jos, Plateau State, Nigeria."}/>
      }/>
      <FadeIn bodyText={
        <ReverseProfile title={"God's Alternative to Bloodshed in Nigeria"} imagesrc={"images/God's_Alternative_to_bloodshed_2013/20240817_123919.jpg"} text={"A vision From the Lord About Plateau State Triggered A Prayer Work on the 19th of April 2013, it was also carried out years later in Lagos on 19th September 2022. hoping to have more of these in the coming future"}/>
      }/>
      <FadeIn bodyText={
        <Profile title={"Evangelism by the Prophetic Force"} imagesrc={"images/God's_Alternative_to_bloodshed_2013/20240817_123919.jpg"} text={`Prophetic Force is a team of Ministers which came to being on March 15, 2012 as a result of a vision of a night when the Lord spoke to His servant, Pastor Mrs Salewa Disu on a group of people, He the Lord is putting together because of the state of insecurity in the nation, Nigeria`}/>
      }/>
      </div>
  );
}

export default Page;
